import React from 'react'
import { Button, Icon } from 'semantic-ui-react'

function DropDown() {
  return (
    <div>
      <Button icon labelPosition="left" basic style = {{fontSize: '2vw', textAlign: 'center', width: '100%', marginBottom: '4%'}}>
        <Icon name="angle down" />
        Students
      </Button>
    </div>
  )
}

export default DropDown
